import React,{useState} from "react"

const FormComponent=()=>{
    const[enteredName, setEnteredName]=useState('')
    const[enteredAge, setEnteredAge]=useState('')
    const onChangeNameHandler=(event)=>{
        console.log(event.target.value)
    }
    const onChangeAgeHandler=(event)=>{
        console.log(event.target.value)
    }
    const onSubmitHandler=(event)=>{
        event.preventDefault()
    }
    return (<div>
        <form onSubmit={onSubmitHandler}>
            <div>
            <label style={{color:'red'}}>Username</label>
            <input type="text" placeholder="Username" onChange={onChangeNameHandler}/>
            </div>
            <div>
            <label style={{color:'red'}} onChange={onChangeAgeHandler}>Age</label>
            <input type="number" placeholder="Enter Age"/>
            </div>
            <div>
            
            <button type="submit" style={{color:'red'}} >Add User</button>
            </div>
            
        </form>


    </div>)
}
export default FormComponent
